	[20201] = {id = 20201, name = "烙铜忤合", bag_type = 2, type = 1051, limit = 999999, sell_get = 0, can_use = false, use_effect = {}, is_feed = false, jump_ids = {1, 4, 7}, attr_list = {}, star = 1, quality = 1, order_id = 996, add_icon = "", yinyang_icon = "", icon = "Textures/Icon/Single/ItemIcon/20033.png", drop_entity_id = 21001, desc = "武器升级用低级素材。\n一种经过特殊方式冶炼制成的液态金属，可以进行二次加工用以强化武器，铜级是其中杂质的称呼。", property1 = 100, property2 = 200},
	[20202] = {id = 20202, name = "烙铁忤合", bag_type = 2, type = 1051, limit = 999999, sell_get = 0, can_use = false, use_effect = {}, is_feed = false, jump_ids = {1, 4, 7}, attr_list = {}, star = 2, quality = 2, order_id = 995, add_icon = "", yinyang_icon = "", icon = "Textures/Icon/Single/ItemIcon/20033.png", drop_entity_id = 21002, desc = "武器升级用中级素材。\n一种经过特殊方式冶炼制成的液态金属，可以进行二次加工用以强化武器，铁级是其中优质品的称呼。", property1 = 500, property2 = 1000},
	[20203] = {id = 20203, name = "烙钢忤合", bag_type = 2, type = 1051, limit = 999999, sell_get = 0, can_use = false, use_effect = {}, is_feed = false, jump_ids = {1, 4, 7}, attr_list = {}, star = 3, quality = 3, order_id = 994, add_icon = "", yinyang_icon = "", icon = "Textures/Icon/Single/ItemIcon/20033.png", drop_entity_id = 21003, desc = "武器升级用高级素材。\n一种经过特殊方式冶炼制成的液态金属，可以进行二次加工用以强化武器，到达钢级以后，液态金属的密度会变得莫名之高，质量自然也是最优。", property1 = 2000, property2 = 4000},
	[20211] = {id = 20211, name = "连营胆", bag_type = 2, type = 1052, limit = 99999, sell_get = 0, can_use = false, use_effect = {}, is_feed = false, jump_ids = {7}, attr_list = {}, star = 3, quality = 3, order_id = 974, add_icon = "", yinyang_icon = "", icon = "Textures/Icon/Single/ItemIcon/20211.png", drop_entity_id = 21003, desc = "利刃武器突破所需初级素材。\n一种可塑性性极强的金属，虽然外部坚硬，但内里却是液体，会缓慢与周遭的其他连营胆进行反应并且融合，在储存时必须每个单独保管。", property1 = 0, property2 = 0},
	[20212] = {id = 20212, name = "连山胆", bag_type = 2, type = 1052, limit = 99999, sell_get = 0, can_use = false, use_effect = {}, is_feed = false, jump_ids = {7}, attr_list = {}, star = 4, quality = 4, order_id = 973, add_icon = "", yinyang_icon = "", icon = "Textures/Icon/Single/ItemIcon/20212.png", drop_entity_id = 21004, desc = "利刃武器突破所需中级素材。\n经过提炼的连营胆，工匠们为了更好利用这种金属会将坚硬的外壳削去一部分，这反而加强了金属本身与同类的融合反应，一不注意它们就会互相反应，变化为小山。", property1 = 0, property2 = 0},
	[20213] = {id = 20213, name = "连龙胆", bag_type = 2, type = 1052, limit = 99999, sell_get = 0, can_use = false, use_effect = {}, is_feed = false, jump_ids = {7}, attr_list = {}, star = 5, quality = 5, order_id = 972, add_icon = "", yinyang_icon = "", icon = "Textures/Icon/Single/ItemIcon/20213.png", drop_entity_id = 21005, desc = "利刃武器突破所需高级素材。\n只剩一层薄壳稳定外形的特殊金属，为了达到极致，工匠们不顾危险制作而成的金属，由于液体在内部翻腾导致金属本身会有心脏一般的跳动感，假若放在一起，就会形成龙一般的形态。", property1 = 0, property2 = 0},
	[20221] = {id = 20221, name = "稀红缨", bag_type = 2, type = 1052, limit = 99999, sell_get = 0, can_use = false, use_effect = {}, is_feed = false, jump_ids = {7}, attr_list = {}, star = 3, quality = 3, order_id = 971, add_icon = "", yinyang_icon = "", icon = "Textures/Icon/Single/ItemIcon/20221.png", drop_entity_id = 21003, desc = "冲击武器突破所需初级素材。\n不知何处而来的物质，细如丝线，能镇魔辟邪，红缨基本只会飘散在极度危险的地方，祈求出入平安的人们往往会在自己重要之物上加绑红缨，以图吉利。", property1 = 0, property2 = 0},
	[20222] = {id = 20222, name = "染红缨", bag_type = 2, type = 1052, limit = 99999, sell_get = 0, can_use = false, use_effect = {}, is_feed = false, jump_ids = {7}, attr_list = {}, star = 4, quality = 4, order_id = 970, add_icon = "", yinyang_icon = "", icon = "Textures/Icon/Single/ItemIcon/20222.png", drop_entity_id = 21004, desc = "冲击武器突破所需中级素材。\n为了增强功效，人为编织的红缨束，原本产量稀少的红缨在经过处理后辟邪的功能再上一层，甚至能当作武器装备的外置气脉。", property1 = 0, property2 = 0},
	[20223] = {id = 20223, name = "炁红缨", bag_type = 2, type = 1052, limit = 99999, sell_get = 0, can_use = false, use_effect = {}, is_feed = false, jump_ids = {7}, attr_list = {}, star = 5, quality = 5, order_id = 969, add_icon = "", yinyang_icon = "", icon = "Textures/Icon/Single/ItemIcon/20223.png", drop_entity_id = 21005, desc = "冲击武器突破所需高级素材。\n经过年月，已经和气脉无异的红缨束，时刻散发着气脉的光辉，普通挥舞就会令邪魅惊惧，这样的红缨会被用作最高等武装之制作，以抗击噬脉。", property1 = 0, property2 = 0},
	[20231] = {id = 20231, name = "不周山谥", bag_type = 2, type = 1052, limit = 99999, sell_get = 0, can_use = false, use_effect = {}, is_feed = false, jump_ids = {7}, attr_list = {}, star = 3, quality = 3, order_id = 968, add_icon = "", yinyang_icon = "", icon = "Textures/Icon/Single/ItemIcon/20211.png", drop_entity_id = 21003, desc = "重压武器突破所需初级素材。\n以不存此世之山来命名，某种龙的鳞片，颜色灰暗，也有裂痕，但丝毫不影响其断钢如泥的锋利。", property1 = 0, property2 = 0},
	[20232] = {id = 20232, name = "瀛洲仙谥", bag_type = 2, type = 1052, limit = 99999, sell_get = 0, can_use = false, use_effect = {}, is_feed = false, jump_ids = {7}, attr_list = {}, star = 4, quality = 4, order_id = 967, add_icon = "", yinyang_icon = "", icon = "Textures/Icon/Single/ItemIcon/20212.png", drop_entity_id = 21004, desc = "重压武器突破所需中级素材。\n以不存此世之州来命名，某种龙的鳞片，呈黑绿色，能作为媒介放大术法的效果，也能切断各种气脉能量的结晶。", property1 = 0, property2 = 0},
	[20233] = {id = 20233, name = "蓬莱境谥", bag_type = 2, type = 1052, limit = 99999, sell_get = 0, can_use = false, use_effect = {}, is_feed = false, jump_ids = {7}, attr_list = {}, star = 5, quality = 5, order_id = 966, add_icon = "", yinyang_icon = "", icon = "Textures/Icon/Single/ItemIcon/20213.png", drop_entity_id = 21005, desc = "重压武器突破所需高级素材。\n以不存此世之境界来命名，真龙的鳞片，呈白金颜色，形状锋锐，上有祥瑞的图形，虽鳞片锋利，但只断奸恶，辨明是非。", property1 = 0, property2 = 0},
	[20241] = {id = 20241, name = "精诚之人", bag_type = 2, type = 1052, limit = 99999, sell_get = 0, can_use = false, use_effect = {}, is_feed = false, jump_ids = {7}, attr_list = {}, star = 3, quality = 3, order_id = 965, add_icon = "", yinyang_icon = "", icon = "Textures/Icon/Single/ItemIcon/20211.png", drop_entity_id = 21003, desc = "爆裂武器突破所需初级素材。\n无从考究出处的技术摹本，在地下交易中广泛流通，按照行内的规矩，这些书物会因内容分成天地人三品，人品内容基本都是模棱两可，不知真伪。", property1 = 0, property2 = 0},
	[20242] = {id = 20242, name = "精诚之地", bag_type = 2, type = 1052, limit = 99999, sell_get = 0, can_use = false, use_effect = {}, is_feed = false, jump_ids = {7}, attr_list = {}, star = 4, quality = 4, order_id = 964, add_icon = "", yinyang_icon = "", icon = "Textures/Icon/Single/ItemIcon/20212.png", drop_entity_id = 21004, desc = "爆裂武器突破所需中级素材。\n无从考究出处的技术摹本，在地下交易中广泛流通，地品的内容属于有所考究，加以注释，在技术实现上可行性较高。", property1 = 0, property2 = 0},
	[20243] = {id = 20243, name = "精诚之天", bag_type = 2, type = 1052, limit = 99999, sell_get = 0, can_use = false, use_effect = {}, is_feed = false, jump_ids = {7}, attr_list = {}, star = 5, quality = 5, order_id = 963, add_icon = "", yinyang_icon = "", icon = "Textures/Icon/Single/ItemIcon/20213.png", drop_entity_id = 21005, desc = "爆裂武器突破所需高级素材。\n无从考究出处的技术摹本，即便是地下交易也鲜有其身影，天品内容晦涩难懂，对于大部分人来说甚至连人品都不如，但若找到办法正确解读，就能获得莫大的利益。", property1 = 0, property2 = 0},
	[20251] = {id = 20251, name = "惊堂木", bag_type = 2, type = 1052, limit = 99999, sell_get = 0, can_use = false, use_effect = {}, is_feed = false, jump_ids = {7}, attr_list = {}, star = 3, quality = 3, order_id = 962, add_icon = "", yinyang_icon = "", icon = "Textures/Icon/Single/ItemIcon/20211.png", drop_entity_id = 21003, desc = "脉象武器突破所需初级素材。\n历史的遗产，曾被用作公堂审理，为了震慑旁人，内部有着与脉者反应的机关，一拍桌案，满庭震慑。", property1 = 0, property2 = 0},
	[20252] = {id = 20252, name = "虎胆木", bag_type = 2, type = 1052, limit = 99999, sell_get = 0, can_use = false, use_effect = {}, is_feed = false, jump_ids = {7}, attr_list = {}, star = 4, quality = 4, order_id = 961, add_icon = "", yinyang_icon = "", icon = "Textures/Icon/Single/ItemIcon/20212.png", drop_entity_id = 21004, desc = "脉象武器突破所需中级素材。\n历史的遗产，曾被用作军务定决，除了木料讲究以外，内部还藏有名为虎胆的机关，即便用作武器也毫无问题。", property1 = 0, property2 = 0},
	[20253] = {id = 20253, name = "霞落木", bag_type = 2, type = 1052, limit = 99999, sell_get = 0, can_use = false, use_effect = {}, is_feed = false, jump_ids = {7}, attr_list = {}, star = 5, quality = 5, order_id = 960, add_icon = "", yinyang_icon = "", icon = "Textures/Icon/Single/ItemIcon/20213.png", drop_entity_id = 21005, desc = "脉象武器突破所需高级素材。\n历史的遗产，朝代皇制还在时被皇室成员广泛使用，和前两者不同并非用来拍在桌案上，只用作身份象征，木身做了严谨精细的雕刻，仅仅碰撞就能听见凤霞之声。", property1 = 0, property2 = 0},
	[20321] = {id = 20321, name = "常流金炁通牒", bag_type = 2, type = 1052, limit = 99999, sell_get = 0, can_use = false, use_effect = {}, is_feed = false, jump_ids = {5}, attr_list = {}, star = 3, quality = 3, order_id = 959, add_icon = "", yinyang_icon = "", icon = "Textures/Icon/Single/ItemIcon/20321.png", drop_entity_id = 21003, desc = "金属性角色技能升级所需素材。\n一种由职业协会批发的金属性脉者用初级文件，可以用其在各个城市宗门中修习或者学的技艺。", property1 = 0, property2 = 0},
